INSERT INTO `demo_wc_admin_notes` VALUES (1,'wc-admin-onboarding-email-marketing','info','en_US','Astuces, mises à jour des produits et inspiration','Nous sommes là pour vous, obtenir des astuces, mises à jour de produits et inspirations directement dans votre boîte e-mail','{}','unactioned','woocommerce-admin','2020-08-22 11:53:08',NULL,0,'plain','',1,'info'),(2,'wc-admin-marketing-intro','info','en_US','Connectez-vous à votre audience','Faites croître votre base clients et augmentez vos ventes avec les outils marketing créés pour WooCommerce.','{}','actioned','woocommerce-admin','2020-08-22 11:53:08',NULL,0,'plain','',0,'info'),(3,'wc-admin-wc-helper-connection','info','en_US','Se connecter à WooCommerce.com','Connectez-vous pour obtenir des notifications et des mises à jour importantes sur les produits.','{}','unactioned','woocommerce-admin','2020-08-22 11:53:09',NULL,0,'plain','',1,'info'),(5,'ecomm-need-help-setting-up-your-store','info','en_US','Need help setting up your Store?','Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. We’re happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.','{}','pending','woocommerce.com','2020-08-19 17:55:35',NULL,0,'plain','',0,'info'),(6,'woocommerce-services','info','en_US','WooCommerce Shipping & Tax','WooCommerce Shipping &amp; Tax helps get your store “ready to sell” as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.','{}','pending','woocommerce.com','2020-08-19 17:55:35',NULL,0,'plain','',0,'info'),(7,'ecomm-unique-shopping-experience','info','en_US','For a shopping experience as unique as your customers','Product Add-Ons allow your customers to personalize products while they’re shopping on your online store. No more follow-up email requests—customers get what they want, before they’re done checking out. Learn more about this extension that comes included in your plan.','{}','pending','woocommerce.com','2020-08-19 17:55:35',NULL,0,'plain','',0,'info'),(8,'wc-admin-orders-milestone','info','en_US','Première commande reçue','Félicitations pour votre première commande ! C\'est le moment idéal pour apprendre à gérer vos commandes.','{}','unactioned','woocommerce-admin','2020-08-22 14:53:48',NULL,0,'plain','',0,'info'),(9,'wc-admin-launch-checklist','info','en_US','Prêt à lancer votre boutique ?','Pour ne jamais ressentir cette sensation d\'avoir oublié quelque chose, nous avons conçu une liste de contrôle reprenant les points essentiels avant lancement.','{}','unactioned','woocommerce-admin','2020-08-23 21:15:46',NULL,0,'plain','',0,'info'),(10,'wc-admin-mobile-app','info','en_US','Installer l\'application mobile Woo','Installez l\'application mobile WooCommerce pour gérer les commandes, recevoir des notifications de vente et afficher les statistiques principales où que vous soyez.','{}','unactioned','woocommerce-admin','2020-08-24 15:27:31',NULL,0,'plain','',0,'info'),(11,'wc-admin-personalize-store','info','en_US','Personnalisez la page d’accueil de votre boutique','La page d’accueil est l’un des points d’accès à votre boutique les plus importants. Si elle est bien faite, elle peut vous permettre d’obtenir plus de conversions et d’engagement. N’oubliez pas de personnaliser la page d’accueil que nous avons créée pour votre boutique pendant l’intégration.','{}','unactioned','woocommerce-admin','2020-09-11 15:28:42',NULL,0,'plain','',0,'info'),(12,'wc-admin-store-notice-giving-feedback-2','info','en_US','Donner des commentaires','Maintenant que vous nous avez choisis comme partenaire, notre objectif est de nous assurer que nous vous fournissons les bons outils pour répondre à vos besoins. Nous sommes impatients de recevoir vos commentaires sur votre expérience de conception de la boutique pour que nous puissions l\'améliorer à l\'avenir.','{}','unactioned','woocommerce-admin','2020-09-11 15:28:42',NULL,0,'plain','',0,'info'),(13,'wc-admin-insight-first-sale','survey','en_US','Le saviez-vous ?','Une boutique optimisée par WooCommerce nécessite en moyenne 31 jours pour réaliser sa première vente. Vous êtes sur la bonne voie ! Trouvez-vous ce type d\'information utile ?','{}','unactioned','woocommerce-admin','2020-09-11 15:28:42',NULL,0,'plain','',0,'info'),(14,'wc-admin-home-screen-feedback','info','en_US','Aidez-nous à améliorer l\'écran d\'accueil de WooCommerce','Nous aimerions votre contribution pour concevoir ensemble l\'écran d\'accueil de WooCommerce. N\'hésitez pas à partager vos commentaires, idées ou suggestions avec nous.','{}','unactioned','woocommerce-admin','2020-09-11 15:28:42',NULL,0,'plain','',0,'info'),(15,'wc-update-db-reminder','update','en_US','WooCommerce database update done','WooCommerce database update complete. Thank you for updating to the latest version!','{}','actioned','woocommerce-core','2020-11-07 02:24:46',NULL,0,'plain','',0,'info'),(16,'mailchimp-for-woocommerce-incomplete-install','warning','en_US','Mailchimp For WooCommerce','Plugin is not yet connected to a Mailchimp account. To complete the connection, open the settings page.','{\"getting_started\":true,\"activated\":1605806686,\"activated_formatted\":\"November 19th\"}','unactioned','mailchimp-for-woocommerce','2020-11-19 16:24:46',NULL,0,'plain','',0,'info'),(17,'wc-admin-real-time-order-alerts','info','en_US','Get real-time order alerts anywhere','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.','{}','unactioned','woocommerce-admin','2020-11-20 14:03:42',NULL,0,'plain','',0,'info'),(18,'wcpay-promo-2020-11','marketing','en_US','Manage subscriber payments from your store\'s dashboard','Securely accept cards and manage transactions right from your dashboard with <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Payments</a>  – now supporting <a href=\"https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Subscriptions</a>! <br /><br /><em>By clicking \"Install now,\" you agree to our <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">Terms of Service</a>.</em>','{}','pending','woocommerce.com','2020-12-02 10:09:10',NULL,0,'plain','',0,'info'),(19,'wcpay-subscriptions-2020-11','marketing','en_US','Manage subscriber payments from your store\'s dashboard','Securely accept cards and manage transactions right from your dashboard with <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Payments</a>  – now supporting <a href=\"https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Subscriptions</a>! <br /><br /><em>By clicking \"Install now,\" you agree to our <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">Terms of Service</a>.</em>','{}','pending','woocommerce.com','2020-12-02 10:09:10',NULL,0,'plain','',0,'info'),(20,'wcpay-promo-2020-12','marketing','en_US','Get 50% off transaction fees with WooCommerce Payments','Keep more of your hard-earned cash by adding <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_exp20\" target=\"_blank\">WooCommerce Payments</a> to your store. Lock in a discounted rate of 1.5% + $0.15 for $25,000 of payments (or three months, whichever comes first). Limited time offer – don’t miss out! <br /><br /><em>By clicking \"Install now,\" you agree to our promotional <a href=\"https://woocommerce.com/terms-conditions/woocommerce-payments-promotion/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_exp20\" target=\"_blank\">Terms of Service</a>.</em>','{}','pending','woocommerce.com','2020-12-09 20:08:07',NULL,0,'plain','',0,'info'),(21,'wcpay-subscriptions-2020-12','marketing','en_US','Manage payments from your store\'s dashboard','Securely accept cards and manage transactions right from your dashboard with <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Payments</a>! Zero setup fees or monthly fees. Just pay-as-you-go, starting at just 2.9% + $0.30 per transaction for U.S.-issued cards. <br /><br /><em>By clicking \"Install now,\" you agree to our <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">Terms of Service</a>.</em>','{}','pending','woocommerce.com','2020-12-09 20:08:07',NULL,0,'plain','',0,'info');
